import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


class CountryRow extends React.Component{
	render(){
		return(
			<li>
				<div>
					{this.name}
				</div>
			</li>
		);
	}
}

class CountriesList extends React.Component{
	renderContryRow(name) {
    return (
      <CountryRow 
        value={name}
        onClick={() => allert(name)}
      />
    );
  }

	render(){
		return(
			<div className="countriesList">
				<ul>
					<CountryRow />
					<CountryRow />
					<CountryRow />
				</ul>
			</div>
		);
	}
}


ReactDOM.render(<CountriesList />, document.getElementById('root'));
